import React, { useState } from "react";
import styled from "styled-components";

const Container = styled.div`
  background-color: #243b55;
  color: #ffffff;
  font-family: "Playfair Display", serif;
  font-weight: 600;
  min-height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Card = styled.div`
  background-color: #1b2735;
  padding: 20px;
  border-radius: 10px;
  width: 80%;
  max-width: 700px;
  box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.5);
`;

const Title = styled.h1`
  text-align: center;
  margin-bottom: 20px;
`;

const FormGroup = styled.div`
  margin-bottom: 15px;
`;

const Label = styled.label`
  display: block;
  margin-bottom: 8px;
`;

const TextBox = styled.input`
  width: 100%;
  padding: 10px;
  font-size: 16px;
  font-family: "Playfair Display", serif;
  font-weight: 600;
  border-radius: 5px;
  border: 1px solid #ccc;
  background: #302f2f;
  color: white;
`;

const TextArea = styled.textarea`
  width: 100%;
  padding: 10px;
  font-size: 16px;
  font-family: "Playfair Display", serif;
  font-weight: 600;
  border-radius: 5px;
  border: 1px solid #ccc;
  background: #302f2f;
  color: white;
`;

const ImageUploadContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-bottom: 20px;
`;

const UploadButton = styled.label`
  display: flex;
  justify-content: center;
  align-items: center;
  background: #1b2735;
  border: 2px dashed #ccc;
  width: 150px;
  height: 150px;
  border-radius: 10px;
  cursor: pointer;
  margin-bottom: 10px;
  &:hover {
    background: #333b47;
  }
`;

const ImagePreview = styled.img`
  max-width: 100px;
  max-height: 100px;
  border-radius: 10px;
`;

const Button = styled.button`
  background-color: ${(props) => props.color};
  color: #ffffff;
  border: none;
  padding: 10px 20px;
  border-radius: 5px;
  font-family: "Playfair Display", serif;
  font-weight: 600;
  margin-right: 10px;
  cursor: pointer;
  &:disabled {
    background-color: #999;
    cursor: not-allowed;
  }
`;

const Tag = styled.button`
  background-color: #b66f0a;
  color: #ffffff;
  border: none;
  padding: 5px 10px;
  border-radius: 5px;
  font-family: "Playfair Display", serif;
  font-weight: 600;
  margin: 5px;
  cursor: pointer;
`;

const Footer = styled.div`
  text-align: center;
  margin-top: 20px;
  font-size: 14px;
`;

const App = () => {
  const [image, setImage] = useState(null);
  const [recommend, setRecommend] = useState(null);
  const [tags, setTags] = useState([]);
  const [review, setReview] = useState({ title: "", location: "", content: "" });

  const handleTagToggle = (tag) => {
    setTags((prev) =>
      prev.includes(tag) ? prev.filter((t) => t !== tag) : [...prev, tag]
    );
  };

  const handleImageChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onloadend = () => setImage(reader.result);
      reader.readAsDataURL(file);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setReview((prev) => ({ ...prev, [name]: value }));
  };

  return (
    <Container>
      <Card>
        <Title>Leave a Review</Title>
        <ImageUploadContainer>
          <UploadButton>
            <input
              type="file"
              style={{ display: "none" }}
              onChange={handleImageChange}
            />
            {image ? (
              <ImagePreview src={image} alt="Uploaded" />
            ) : (
              <span>+</span>
            )}
          </UploadButton>
        </ImageUploadContainer>
        <FormGroup>
          <Label>Review Title</Label>
          <TextBox
            type="text"
            maxLength={50}
            placeholder="Enter title..."
            name="title"
            value={review.title}
            onChange={handleInputChange}
          />
        </FormGroup>
        <FormGroup>
          <Label>Location</Label>
          <TextBox
            type="text"
            maxLength={50}
            placeholder="Enter location..."
            name="location"
            value={review.location}
            onChange={handleInputChange}
          />
        </FormGroup>
        <FormGroup>
          <Label>Enter Review</Label>
          <TextArea
            rows={5}
            maxLength={250}
            placeholder="Write your review..."
            name="content"
            value={review.content}
            onChange={handleInputChange}
          />
        </FormGroup>
        <div>
          <Button
            color="#1d707f"
            disabled={recommend === "not"}
            onClick={() => setRecommend("yes")}
          >
            Recommend
          </Button>
          <Button
            color="#1d707f"
            disabled={recommend === "yes"}
            onClick={() => setRecommend("not")}
          >
            Not Recommended
          </Button>
        </div>
        <div>
          {["Adventure", "Night Life", "Group Travel", "Scenic Views", "Nature"].map(
            (tag) => (
              <Tag
                key={tag}
                onClick={() => handleTagToggle(tag)}
                style={{
                  backgroundColor: tags.includes(tag) ? "#FF922B" : "#b66f0a",
                }}
              >
                {tag}
              </Tag>
            )
          )}
        </div>
        <Footer>Created December 6th, 2024</Footer>
      </Card>
    </Container>
  );
};

export default App;

